Обратите внимание, что страница <strong>не будет</strong> переименована, если уже существует страница с названием, идентичным выбранному, кроме случаев, когда такая страница пуста или представляет собой перенаправление, и при этом не имеет истории правок.
Это означает, что сделав ошибочное переименование, вы можете переименовать страницу обратно в то название, которое у неё только что было, но не можете случайно затереть существующую страницу.

<strong>Примечание:</strong>
Переименование популярных страниц может привести к масштабным и неожиданным изменениям.
Пожалуйста, прежде чем продолжать, убедитесь, что понимаете все возможные последствия.',
	'messages:movepagetext-noredirectfixer' => 'ru:Воспользовавшись формой ниже, вы переименуете страницу, одновременно переместив на новое место её журнал изменений.
