	'messages:apihelp-main-extended-description' => 'ru:<div class="hlist plainlinks api-main-links">
* [[mw:Special:MyLanguage/API:Main_page|Документация]]
* [[mw:Special:MyLanguage/API:Etiquette|Этикет и руководство по использованию]]
