* [https://lists.wikimedia.org/postorius/lists/mediawiki-api-announce.lists.wikimedia.org/ Новости API]
* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Ошибки и запросы]
</div>
<strong>Статус:</strong> MediaWiki API — зрелый и стабильный интерфейс, активно поддерживаемый и улучшаемый. Мы стараемся избегать ломающих изменений, однако изредка они могут быть необходимы. Подпишитесь на [https://lists.wikimedia.org/hyperkitty/list/mediawiki-api-announce@lists.wikimedia.org/ почтовую рассылку mediawiki-api-announce], чтобы быть в курсе обновлений.

<strong>Ошибочные запросы:</strong> Если API получает запрос с ошибкой, вернётся заголовок HTTP с ключом «MediaWiki-API-Error», после чего значение заголовка и код ошибки будут отправлены обратно и установлены в то же значение. Более подробную информацию см. [[mw:Special:MyLanguage/API:Errors_and_warnings|API: Ошибки и предупреждения]].

<p class="mw-apisandbox-link"><strong>Тестирование:</strong> для удобства тестирования API-запросов, см. [[Special:ApiSandbox]].</p>',
	'messages:apihelp-main-param-action' => 'ru:Действие, которое следует выполнить.',
	'messages:apihelp-main-param-format' => 'ru:Формат вывода.',
	'messages:apihelp-main-param-maxlag' => 'ru:Значение максимального отставания может использоваться, когда MediaWiki установлена на кластер из реплицируемых баз данных. Чтобы избежать ухудшения ситуации с отставанием репликации сайта, этот параметр может заставить клиента ждать, когда задержка репликации станет ниже указанного значения. В случае чрезмерной задержки возвращается код ошибки «<samp>maxlag</samp>» с сообщением «<samp>Waiting for $host: $lag seconds lagged</samp>».<br>См. подробнее на странице с описанием [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Manual: параметра Maxlag]].',
	'messages:apihelp-main-param-smaxage' => 'ru:Установить значение HTTP-заголовка Cache-Control <code>s-maxage</code> в заданное число секунд. Ошибки никогда не кэшируются.',
	'messages:apihelp-main-param-maxage' => 'ru:Установить значение HTTP-заголовка Cache-Control <code>max-age</code> в заданное число секунд. Ошибки никогда не кэшируются.',
	'messages:apihelp-main-param-assert' => 'ru:Проверить, авторизован ли участник, если задано <kbd>user</kbd>, <em>not</em> авторизирован если задано <kbd>anon</kbd> или что он имеет права бота, если задано <kbd>bot</kbd>.',
	'messages:apihelp-main-param-assertuser' => 'ru:Проверить, что ник текущего участника совпадает с заданным.',
	'messages:apihelp-main-param-requestid' => 'ru:Любое заданное здесь значение будет включено в ответ. Может быть использовано для различения запросов.',
	'messages:apihelp-main-param-servedby' => 'ru:Включить в результаты имя сервера, обработавшего запрос.',
	'messages:apihelp-main-param-curtimestamp' => 'ru:Включить в результат временную метку.',
	'messages:apihelp-main-param-responselanginfo' => 'ru:Включить языки, использованные для <var>uselang</var> и <var>errorlang</var>, в результат.',
	'messages:apihelp-main-param-origin' => 'ru:При обращении к API с использованием кросс-доменного AJAX-запроса (CORS), задайте параметру значение исходного домена. Этот параметр должен быть включён в любой предварительный запрос и таким образом должен быть частью URI-запроса (не тела POST).

Для аутентифицированных запросов он должен точно соответствовать одному из источников в заголовке <code>Origin</code>, так что он должен быть задан наподобие <kbd>https://ru.wikipedia.org</kbd> или <kbd>https://meta.wikimedia.org</kbd>. Если параметр не соответствует заголовку <code>Origin</code>, будет возвращён ответ с кодом ошибки 403. Если параметр соответствует заголовку <code>Origin</code>, и источник разрешается, будут установлены заголовки <code>Access-Control-Allow-Origin</code> и <code>Access-Control-Allow-Credentials</code>.

Для неаутентифицированных запросов укажите значение <kbd>*</kbd>. В результате заголовок <code>Access-Control-Allow-Origin</code> будет установлен, но <code>Access-Control-Allow-Credentials</code> примет значение <code>false</code> и все пользовательские данные будут ограничены.',
	'messages:apihelp-main-param-uselang' => 'ru:Язык, используемый для перевода сообщений. Запрос <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo&siprop=languages]]</kbd> возвращает список кодов языков. Вы можете указать <kbd>user</kbd>, чтобы использовать текущие языковые настройки участника, или <kbd>content</kbd> для использования основного языка этой вики.',
	'messages:apihelp-main-param-variant' => 'ru:Вариант языка. Работает только в том случае, если базовый язык поддерживает преобразование вариантов.',
	'messages:apihelp-main-param-errorformat' => 'ru:Формат, используемый для вывода текста предупреждений и ошибок',
	'messages:apihelp-main-paramvalue-errorformat-plaintext' => 'ru:Вики-текст с удалёнными HTML-метками и заменёнными энтити.',
	'messages:apihelp-main-paramvalue-errorformat-wikitext' => 'ru:Нераспарсированный вики-текст.',
	'messages:apihelp-main-paramvalue-errorformat-raw' => 'ru:Ключ сообщения и параметры.',
	'messages:apihelp-main-paramvalue-errorformat-none' => 'ru:Не выводит текст, только коды ошибок.',
	'messages:apihelp-main-paramvalue-errorformat-bc' => 'ru:Формат, использовавшийся до MediaWiki 1.29. <var>errorlang</var> и <var>errorsuselocal</var> игнорируются.',
	'messages:apihelp-main-param-errorlang' => 'ru:Язык, используемый для вывода предупреждений и сообщений об ошибках. Запрос <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo&siprop=languages]]</kbd> возвращает список кодов языков. Укажите <kbd>content</kbd> для использования основного языка этой вики, или <kbd>uselang</kbd> для использования того же значения, что и в параметре <var>uselang</var>.',
	'messages:apihelp-main-param-errorsuselocal' => 'ru:Если задан, тексты ошибок будут использовать локально модифицированные сообщения из пространства имён {{ns:MediaWiki}}.',
	'messages:apihelp-acquiretempusername-summary' => 'ru:Получить временное имя пользователя и сохраните его в текущем сеансе, если создание временной учетной записи включено и текущий пользователь вышел из системы. Если имя уже сохранено, возвращается то же имя.',
	'messages:apihelp-acquiretempusername-extended-description' => 'ru:Если позже пользователь выполнит действие, которое приведёт к созданию временной учётной записи, для его учётной записи будет использовано имя пользователя из временного хранилища (stashed username). Его также можно использовать в предпросмотре. Однако учётная запись еще не создана, и её название не видно другим пользователям.',
	'messages:apihelp-block-summary' => 'ru:Блокировка участника.',
	'messages:apihelp-block-param-id' => 'ru:Идентификатор блокировки для изменения.',
	'messages:apihelp-block-param-user' => 'ru:Имя участника, которого вы хотите заблокировать.',
	'messages:apihelp-block-param-userid' => 'ru:Вместо этого укажите <kbd>$1user=#<var>ID</var></kbd>.',
	'messages:apihelp-block-param-expiry' => 'ru:Время истечения срока действия. Может быть относительным (например, <kbd>5 months</kbd> или <kbd>2 weeks</kbd>) или абсолютным (например, <kbd>2014-09-18T12:34:56Z</kbd>). Если задано <kbd>infinite</kbd>, <kbd>indefinite</kbd> или <kbd>never</kbd>, блокировка никогда не истечёт.',
	'messages:apihelp-block-param-reason' => 'ru:Причина блокировки.',
	'messages:apihelp-block-param-anononly' => 'ru:Заблокировать только анонимных участников (т. е. запретить анонимные правки для этого IP-адреса, включая правки с временной учётной записи).',
	'messages:apihelp-block-param-nocreate' => 'ru:Запретить создание учётных записей.',
	'messages:apihelp-block-param-autoblock' => 'ru:Автоматически блокировать последний использованный IP-адрес и все последующие, с которых будут совершаться попытки авторизации.',
	'messages:apihelp-block-param-noemail' => 'ru:Запретить участнику отправлять электронную почту через интерфейс вики. (Требуется право <code>blockemail</code>).',
