	'messages:apihelp-block-param-allowusertalk' => 'ru:Разрешить участнику редактировать свою страницу обсуждения (зависит от <var>[[mw:Special:MyLanguage/Manual:$wgBlockAllowsUTEdit|$wgBlockAllowsUTEdit]]</var>).',
	'messages:apihelp-block-param-reblock' => 'ru:Если участник уже заблокирован одной блокировкой, перезаписать существующую блокировку. Если участник заблокирован более одного раза, это не сработает — используйте параметр <var>id</var> вместо этого, чтобы указать, какую блокировку перезаписывать.',
