	'messages:apihelp-compare-summary' => 'ru:Получение разницы между двумя страницами.',
	'messages:apihelp-compare-extended-description' => 'ru:Номер версии, заголовок страницы, её идентификатор, текст, или относительная сноска должна быть задана как для «from», так и для «to».',
