	'messages:apihelp-compare-param-fromrev' => 'ru:Первая сравниваемая версия.',
	'messages:apihelp-compare-param-frompst' => 'ru:Выполнить преобразование перед записью правки (PST) над <var>fromtext-&#x7B;slot}</var>.',
	'messages:apihelp-compare-param-fromslots' => 'ru:Переопределение содержимого версии, заданной параметром <var>fromtitle</var>, <var>fromid</var> или <var>fromrev</var>.

Этот параметр определяет ячейки, которые должны быть изменены. Используйте <var>fromtext-&#x7B;slot}</var>, <var>fromcontentmodel-&#x7B;slot}</var>, и <var>fromcontentformat-&#x7B;slot}</var> для определения содержимого для каждой ячейки.',
	'messages:apihelp-compare-param-fromtext-{slot}' => 'ru:Текст указанной ячейки. Если этот текст опущен, то ячейка удаляется из версии.',
	'messages:apihelp-compare-param-fromsection-{slot}' => 'ru:Если <var>fromtext-&#x7B;slot}</var> является содержимым одного раздела, то это идентификатор раздела. Он будет объединён с версией, указанной <var>fromtitle</var>, <var>fromid</var> или <var>fromrev</var>, как при редактировании раздела.',
	'messages:apihelp-compare-param-fromcontentmodel-{slot}' => 'ru:Модель содержимого <var>fromtext-&#x7B;slot}</var>. Если она не указана, то она будет угадана на основе других параметров.',
