	'messages:apihelp-compare-param-fromsection' => 'ru:Использовать только указанный раздел из содержимого «from».',
	'messages:apihelp-compare-param-totitle' => 'ru:Заголовок второй сравниваемой страницы.',
	'messages:apihelp-compare-param-toid' => 'ru:Идентификатор второй сравниваемой страницы.',
