	'messages:apihelp-compare-param-torelative' => 'ru:Использовать версию, относящуюся к определённой <var>fromtitle</var>, <var>fromid</var> или <var>fromrev</var>. Все другие параметры «to» будут проигнорированы.',
	'messages:apihelp-compare-param-topst' => 'ru:Выполнить преобразование перед записью правки (PST) над <var>totext</var>.',
	'messages:apihelp-compare-param-toslots' => 'ru:Переопределяет содержимое версии, заданной параметрами <var>totitle</var>, <var>toid</var> или <var>torev</var>.

