	'messages:apihelp-compare-param-tosection-{slot}' => 'ru:Если <var>totext-&#x7B;slot}</var> является содержимым одного раздела, то это идентификатор раздела. Она будет объединена с версией, указанной в <var>totitle</var>, <var>toid</var> или <var>torev</var>, как при редактировании раздела.',
	'messages:apihelp-compare-param-tocontentmodel-{slot}' => 'ru:Модель содержимого <var>totext-&#x7B;slot}</var>. Если не задана, будет угадана по другим параметрам.',
