	'messages:api-help-templatedparams-header' => 'ru:Шаблонные параметры',
	'messages:api-help-templatedparams' => 'ru:Шаблонные параметры используются в случаях, когда модулю API нужно получить по параметру со значением на каждое значение другого параметра. Например, если бы был модуль API, запрашивающий фрукты, у него мог бы быть параметр <var>фрукты</var>, указывающий, какие фрукты запрашиваются, и шаблонный параметр <var>{фрукт}-в-количестве</var>, указывающий, сколько фруктов каждого вида запросить. Клиент API, который хочет запросить 1 яблоко, 5 бананов и 20 апельсинов, мог бы тогда сделать запрос наподобие <kbd>фрукты=яблоки|бананы|апельсины&яблоки-в-количестве=1&бананы-в-количестве=5&апельсины-в-количестве=20</kbd>.',
