	'messages:api-help-right-apihighlimits' => 'ru:Использовать высокие лимиты в запросах API (медленные запросы: $1, быстрые запросы: $2). Лимиты для медленных запросов также применимы к параметрам со множеством значений.',
	'messages:api-help-open-in-apisandbox' => 'ru:<small>[открыть в песочнице]</small>',
	'messages:api-help-authmanager-general-usage' => 'ru:Стандартная процедура использования этого модуля такова:
# Запрос полей, доступных из <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> с <kbd>amirequestsfor=$4</kbd>, и токена <kbd>$5</kbd> из <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.
# Предоставление полей пользователю и получение его данных.
# Запрос к этому модулю, содержащий <var>$1returnurl</var> или аналогичное поле.
# Проверка поля <samp>status</samp> ответа.
#* Если вы получили <samp>PASS</samp> или <samp>FAIL</samp>, вы закончили. Операция либо завершилась успехом, либо нет.
#* Если вы получили <samp>UI</samp>, предоставьте новые поля пользователю и получите новые данные. Затем совершите новый запрос с параметром <var>$1continue</var> и новыми полями, после чего повторите пункт 4.
#* Если вы получили <samp>REDIRECT</samp>, отправьте пользователя на <samp>redirecttarget</samp> и подождите возвращения на <var>$1returnurl</var>. Затем совершите запрос к этому модулю с параметром <var>$1continue</var> и всеми полями, содержащимися в возвращённой ссылке, и повторите пункт 4.
#* Если вы получили <samp>RESTART</samp>, это означает, что аутентификация работает, но мы не привязали пользовательскую учётную запись. Вы можете рассматривать это как <samp>UI</samp> или <samp>FAIL</samp>.',
	'messages:api-help-authmanagerhelper-requests' => 'ru:Использовать только эти аутентификационные запросы, с <samp>id</samp>, возвращённом из <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> с <kbd>amirequestsfor=$1</kbd>, или из предыдущего ответа этого модуля.',
	'messages:api-help-authmanagerhelper-request' => 'ru:Использовать этот аутентификационный запрос, с <samp>id</samp>, возвращённом из <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> с <kbd>amirequestsfor=$1</kbd>.',
	'messages:api-help-authmanagerhelper-messageformat' => 'ru:Формат, используемый для возвращаемых сообщений.',
	'messages:api-help-authmanagerhelper-mergerequestfields' => 'ru:Слить поля информации со всех аутентификационных запросов в один массив.',
	'messages:api-help-authmanagerhelper-preservestate' => 'ru:Сохранить состояние с предыдущей провалившейся попытки авторизации, если возможно.',
	'messages:api-help-authmanagerhelper-returnurl' => 'ru:Вернуть ссылку для стороннего процесса аутентификации, должна быть абсолютной. Либо этот параметр, либо <var>$1continue</var>, обязателен.

После получения ответа <samp>REDIRECT</samp>, вы, как правило, должны открыть в браузере или вэб-просмотрщике указанную в <samp>redirecttarget</samp> ссылку для продолжения стороннего процесса аутентификации. По завершению, сторонний сервис отошлёт браузеру или веб-просмотрщику эту ссылку. Вы должны извлечь все параметры из ссылки и отослать их в параметр <var>$1continue</var> запроса к этому модулю.',
	'messages:api-help-authmanagerhelper-continue' => 'ru:Этот запрос — продолжение после предшествующего ответа <samp>UI</samp> или <samp>REDIRECT</samp>. Либо этот параметр, либо <var>$1returnurl</var>, обязателен.',
	'messages:api-help-authmanagerhelper-additional-params' => 'ru:Этот модуль принимает дополнительные параметры в зависимости от доступных аутентификационных запросов. Используйте <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> с <kbd>amirequestsfor=$1</kbd> (или предыдущий ответ этого модуля, если доступен) для определения, какие запросы доступны и какие поля они используют.',
