	'messages:config-admin-error-password' => 'ru:Внутренняя ошибка при установке пароля для учётной записи администратора «<nowiki>$1</nowiki>»: <pre>$2</pre>',
	'messages:config-admin-error-password-invalid' => 'ru:Неверный пароль администратора вики-проекта: $1',
	'messages:config-admin-error-bademail' => 'ru:Вы ввели неправильный адрес электронной почты.',
	'messages:config-subscribe' => 'ru:Подписаться на [https://lists.wikimedia.org/postorius/lists/mediawiki-announce.lists.wikimedia.org/ рассылку новостей о появлении новых версий MediaWiki].',
	'messages:config-subscribe-help' => 'ru:Это список рассылки с малым числом сообщений, используется для анонса новых выпусков и сообщений о проблемах с безопасностью.
Вам следует подписаться на него и обновлять движок MediaWiki, по мере выхода новых версий.',
	'messages:config-subscribe-noemail' => 'ru:Вы попытались подписаться на список рассылки уведомлений о новых выпусках без указания адреса электронной почты.
Укажите адрес электронной почты, если вы хотите подписаться на список рассылки.',
	'messages:config-pingback' => 'ru:Поделиться сведениями об этой установке с разработчикам MediaWiki.
[https://foundation.wikimedia.org/wiki/MediaWiki_Pingback_Privacy_Statement Политика конфиденциальности].',
	'messages:config-pingback-help' => 'ru:Если вы выберите этот вариант, MediaWiki будет периодически отправлять на https://www.mediawiki.org основные сведения об этом экземпляре MediaWiki. К этим данным относятся, в частности, тип операционной системы, версия PHP и выбранная СУБД. Фонд Викимедиа делится этими данными с разработчиками MediaWiki, чтобы помочь им в дальнейшей разработке. Следующие данные будут отправлены для вашей системы:
<pre>$1</pre>

Политика конфиденциальности находится по адресу  https://foundation.wikimedia.org/wiki/MediaWiki_Pingback_Privacy_Statement.

Почитать подробнее об этой функции вы можете здесь: https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgPingback.

Агрегированные pingback данные можно найти тут: https://pingback.wmcloud.org/',
	'messages:config-almost-done' => 'ru:Вы почти у цели!
Остальные настройки можно пропустить и приступить к установке вики.',
	'messages:config-optional-continue' => 'ru:Произвести тонкую настройку',
	'messages:config-optional-skip' => 'ru:Хватит уже, просто установите вики.',
	'messages:config-profile' => 'ru:Профиль прав прользователей:',
	'messages:config-profile-wiki' => 'ru:Открытая вики',
	'messages:config-profile-no-anon' => 'ru:Требуется создание учётной записи',
	'messages:config-profile-fishbowl' => 'ru:Только для авторизованных редакторов',
	'messages:config-profile-private' => 'ru:Закрытая вики',
	'messages:config-profile-help' => 'ru:Вики-технология лучше всего работает, когда вы позволяете редактировать сайт максимально широкому кругу лиц.
В MediaWiki легко просмотреть последних изменений и, при необходимости, откатить любой ущерб сделанный злоумышленниками или наивными пользователями.

Однако, движок MediaWiki можно использовать и иными способами, и не далеко не всех удаётся убедить в преимуществах открытой вики-работы.
Так что в вас есть выбор.

Модель <strong>«{{int:config-profile-wiki}}»</strong> позволяет всем править страницы даже не регистрируясь на сайте. Конфигурация <strong>{{int:config-profile-no-anon}}</strong> обеспечивает дополнительный учёт, но может отсечь случайных участников.

Сценарий <strong>«{{int:config-profile-fishbowl}}»</strong> разрешает редактирование только определённым участникам, но общедоступным остаётся просмотр страниц, в том числе просмотр истории изменения. В режиме <strong>«{{int:config-profile-private}}»</strong> просмотр страниц разрешён только определённым пользователям, какая-то их часть может иметь также права на редактирование.

Более сложные схемы разграничения прав можно настроить после установки, см. [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:User_rights соответствующее руководство].',
	'messages:config-license' => 'ru:Авторские права и лицензии:',
	'messages:config-license-none' => 'ru:Не указывать лицензию в колонтитуле внизу страницы',
	'messages:config-license-cc-by-sa' => 'ru:Creative Commons Attribution-ShareAlike',
	'messages:config-license-cc-by' => 'ru:Creative Commons Attribution',
	'messages:config-license-cc-by-nc-sa' => 'ru:Creative Commons Attribution-NonCommercial-ShareAlike',
	'messages:config-license-cc-0' => 'ru:Creative Commons Zero (общественное достояние)',
	'messages:config-license-gfdl' => 'ru:GNU Free Documentation License 1.3 или более поздняя',
	'messages:config-license-pd' => 'ru:Общественное достояние',
	'messages:config-license-help' => 'ru:Многие общедоступные вики разрешают использовать свои материалы на условиях [https://freedomdefined.org/Definition/Ru свободных лицензий].
Это помогает созданию чувства общности, стимулирует долгосрочное участие.
Но в этом нет необходимости для частных или корпоративных вики.

Если вы хотите использовать тексты из Википедии или хотите, что в Википедию можно было копировать тексты из вашей вики, вам следует выбрать <strong>{{int:config-license-cc-by-sa}}</strong>.

Википедия ранее использовала лицензию GNU Free Documentation License.
GFDL может быть использована, но она сложна для понимания и осложняет повторное использование материалов.',
