	'messages:config-email-usertalk-help' => 'ru:Разрешить пользователям получать уведомления об изменениях своих страниц обсуждения, если они разрешат это в своих настройках.',
	'messages:config-email-watchlist' => 'ru:Включить уведомление на электронную почту об изменении списка наблюдения',
	'messages:config-email-watchlist-help' => 'ru:Разрешить пользователям получать уведомления об отслеживаемых ими страницах, если они разрешили это в своих настройках.',
	'messages:config-email-auth' => 'ru:Включить аутентификацию через электронную почту',
	'messages:config-email-auth-help' => 'ru:Если эта опция включена, пользователи должны подтвердить свой адрес электронной почты перейдя по ссылке, которая отправляется на электронную почту. Подтверждение требуется каждый раз при смене электронного ящика в настройках пользователя.
Только прошедшие проверку подлинности адреса электронной почты, могут получать электронные письма от других пользователей или изменять уведомления, отправляемые по электронной почте.
Включение этой опции <strong>рекомендуется</strong>  для открытых вики в целях пресечения потенциальных злоупотреблений возможностями электронной почты.',
	'messages:config-email-sender' => 'ru:Обратный адрес эл. почты:',
	'messages:config-email-sender-help' => 'ru:Введите адрес эл. почты для использования в качестве обратного адреса исходящей эл. почты.
На него будут отправляться отказы.
Многие почтовые серверы требуют, чтобы по крайней мере доменное имя в нём было правильным.',
	'messages:config-upload-settings' => 'ru:Загрузка изображений и файлов',
	'messages:config-upload-enable' => 'ru:Разрешить загрузку файлов',
	'messages:config-upload-help' => 'ru:Разрешение загрузки файлов, потенциально, может привести к угрозе безопасности сервера.
Для получения дополнительной информации, прочтите в руководстве [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Security раздел, посвящённый безопасности].

Чтобы разрешить загрузку файлов, необходимо изменить права на каталог <code>images</code>, в корневой директории MediaWiki так, чтобы веб-сервер мог записывать в него файлы.
