	'messages:managewiki-header-core' => 'ru:Вы можете управлять ключевыми настройками этой вики (такими как имя и язык) с этой панели. Отображённые серым цветом параметры могут быть изменены только операторами фермы. По окончании действий нажмите «Сохранить», и указанные вами параметры отобразятся через несколько секунд.

Вы можете управлять дополнительными настройками, такими как логотип и многое другое, на странице [[Special:ManageWiki/settings]].',
	'messages:managewiki-header-core-view' => 'ru:Вы можете просматривать ключевые настройки этой вики на этой панели, но \'\'\'у вас нет разрешения их изменять\'\'\'.

Вы можете просматреть дополнительные настройки, такие как логотип и многое другое, на странице [[Special:ManageWiki/settings]].',
	'messages:managewiki-header-extensions' => 'ru:Вы можете управлять расширениями и скинами этой вики с этой панели. Она отображает все доступные расширения и скины. Если вы не видите нужного вам расширения или скина, обратитесь к системному администратору.

По окончании действий нажмите «Сохранить», и ваши расширения или скины будут установлены через несколько секунд.',
	'messages:managewiki-header-extensions-view' => 'ru:Вы можете просматривать расширения и скины этой вики на этой панели, но \'\'\'у вас нет разрешения ими управлять\'\'\'. Если вам нужно включить расширение или скин, свяжитесь с операторами этой вики.',
	'messages:managewiki-header-namespaces' => 'ru:Вы можете управлять настройками пространств имён этой вики с этой панели. Некоторые настройки будут отображаться только после того, как вы включите расширение. Обратитесь к документации MediaWiki для получения дополнительной информации. По окончании действий нажмите «Сохранить», и указанные вами параметры отобразятся через несколько секунд.',
	'messages:managewiki-header-namespaces-view' => 'ru:Вы можете просматривать настройки пространств имён этой вики на этой панели, но \'\'\'у вас нет разрешения их изменять\'\'\'. Обратитесь к операторам вики, если вам нужна дополнительная помощь.',
	'messages:managewiki-header-permissions' => 'ru:Вы можете управлять настройками групп участников этой вики (такими как разрешения, назначение групп и автоматическое продвижение) с этой панели. Пожалуйста, очень внимательно прочитайте документацию и не удаляйте группы бесцеремонно, иначе ваша вики может сломаться. По окончаний действий нажмите «Сохранить», и указанные вами параметры отобразятся через несколько секунд.

Не все разрешения могут быть назначены. Некоторые из них могут быть зарезервированы только для операторов фермы. Если вы не нашли определенные разрешения, обратитесь к своей ферме.',
	'messages:managewiki-header-permissions-view' => 'ru:Вы можете просматривать настройки групп участников этой вики на этой панели (такие как разрешения, назначения и автопродвижение), но \'\'\'у вас нет разрешения их изменять\'\'\'. Обратитесь к операторам вики, если вам нужна дополнительная помощь.',
	'messages:managewiki-header-settings' => 'ru:Вы можете управлять настройками этой вики (такими как логотип, стиль и прочее) с этой панели. Будьте осторожны! Обязательно внимательно прочитайте описания настроек и не переключайте случайные настройки без разбора, если вы не понимаете, что они делают. По окончании действий нажмите «Сохранить», и указанные вами параметры отобразятся через несколько секунд. 

Выделенные серым параметры могут изменять только операторы фермы. Вы можете управлять ключевыми настройками, такими как название и язык вики, на странице [[Special:ManageWiki/core]].',
	'messages:managewiki-header-settings-view' => 'ru:Вы можете просматривать настройки этой вики (такие как логотип, стиль и прочее) на этой панели, но \'\'\'у вас нет разрешения их изменять\'\'\'.

